import Stack from '@material-ui/core/Stack';
import Box from '@material-ui/core/Box';
import background from "../../resources/images/brot3.png";
import { alpha, styled } from '@material-ui/core/styles';

const SuccessSlider = styled(Box)(() => ({
    width: '100%',
    height: 100,
    color: '#00ffff'
}));

function StudentViewPage() {

    return (
        <div style={{ backgroundImage: `url(${background})` }}>
            <Stack spacing={0}>
                <h1 style={{ textAlign: "center" }}>1</h1>
                <h1 style={{ textAlign: "center" }}>2</h1>
                <h1 style={{ textAlign: "center" }}>3</h1>
                <h1 style={{ textAlign: "center" }}>4</h1>
                <SuccessSlider/>
            </Stack>
        </div>

    )
}

export default StudentViewPage;
